export enum TaskType {
    CODING = "Coding",
    TESTING = "Testing",
    DOCUMENTATION = "Documentation",
    REVIEW = "Review",
    DESIGN = "Design",
    DEBUGGING = "Debugging",
    DEPLOYMENT = "Deployment",
    OPTIMIZATION = "Optimization",
    RESEARCH = "Research",
    PLANNING = "Planning"
}

export enum TaskStatus {
    PENDING = "Pending",
    IN_PROGRESS = "In Progress",
    COMPLETED = "Completed"
}

export interface Task {
    id: string;
    type: TaskType;
    description: string;
    status: TaskStatus;
    assigned_to: string | null;
    batch_number: number;
}

export interface Player {
    id: string;
    name: string;
    current_tasks: Task[];
    completed_tasks: Task[];
}

export interface Game {
    id: string;
    players: Player[];
    current_batch: number;
    max_batches: number;
    tasks_per_batch: number;
    tasks: Task[];
    status: string;
}
